import React from "react";
import styled from "styled-components";
import Product from "./Product";
import {
  image4,
  image3,
  image5,
  image6,
  image7,
  image8,
} from "./../../img/index";
const CategoryContainer = styled.div`
  margin-top: 5vh;
  width: 100%;
  display: flex;
  justify-content: space-around;
  align-items: center;
  flex-wrap: wrap;
  position: -webkit-sticky; /* Safari */
  /* border: 1px solid red; /* BORDER TEST*/

  color: black;

  @media screen and (max-width: 1360px) {
    width: 1000px; /* width less margin */
  }
`;
export default function Products() {
  return (
    <CategoryContainer>
      <Product
        img={image4}
        title="India"
        desc="Blue Orca Coffee"
        price={21.22}
      />
      <Product
        img={image4}
        title="Brazylia Santos"
        desc="Blue Orca Coffee"
        price={20}
      />
      <Product
        img={image5}
        title="Hounduras"
        desc="Blue Orca Coffee"
        price={20}
      />
      <Product
        img={image6}
        title="Hounduras"
        desc="Blue Orca Coffee"
        price={21}
      />
    </CategoryContainer>
  );
}
